import { API } from "../constant/api";
import axios from "axios";

const serviceHome = {
    getHome() {
        return fetch(`${API}`).then(res => res.json());
    }
};



axios({
    method: 'get',
    url: 'http://192.168.0.37:8000/api'
  })
    .then(function (response) {
      console.log(response.data)
    });





export default serviceHome;
